import React from 'react';
import './SidebarOption.css'

export default function SidebarOption({title, Icon}) {
    return (
        <div className = 'sidebarOption'>
            {Icon && <Icon className = 'sidebarOption__icon'></Icon>}
                {Icon? <h4>{title}</h4> : <p>{title}</p> }
              
          
            
        </div>
    )
}
